import React from 'react';
import circle from "../css/circle.css";
import ScrollHorizontal from 'react-scroll-horizontal'
import Ellipse from './Ellipse.png';
//import {StyleSheet, Text, View, Image, TouchableOpacity,ScrollView} from 'react-native';
function Project() {
    const imgs=[Ellipse, Ellipse,Ellipse,Ellipse, Ellipse, Ellipse,Ellipse];
    return (  
        <>     
        <h1 style={{
            height: "34px",
            width: "100px",
            left: "35px",
            top: "90px",
            fontFamily: "Noto Sans",
            fontSize: "25px",
            position: "absolute",
            fontStyle: "normal",
            fontWeight:"600"
        }}>프로젝트</h1>
        <div className='{circle}'></div>
        <div id='scroll-horizontal' style={{height:'55px'}}>
            <ScrollHorizontal>
                {/* <div style={{left:"30px" }}>1기</div> */}
                {/* <div>2기</div> */}
                {/* <div>3</div> */}
                {/* <div>4</div> */}
                {/* <div>5</div> */}
                {/* {imgs} */}
                {/* <div style={{left:'35px'}}> */}
                {/* <div style={{marginTop:'140'}}> */}
                <img src={Ellipse} style={{positionleft:'35px'}}/>
                
                {/* </div> */}
                {/* </div> */}

                {/* <img src={Ellipse}/>
                <img src={Ellipse}/>
                <img src={Ellipse}/>
                <img src={Ellipse}/>
                <img src={Ellipse}/>
                <img src={Ellipse}/> */}
                {/* <div className={{circle}}>dkssyd</div> */}
            </ScrollHorizontal>
        </div>
        </>
    );
}

export default Project
